export default function ViewAllButton() {
    return (
        <button className="flex flex-col text-base text-black w-[104px]">
            <span className="gap-2 self-stretch px-6 py-3 max-w-full bg-blue-500 text-white rounded-xl border border-black border-solid w-[104px] max-md:px-5">
                View all
            </span>
        </button>
    );
}
